import PersonElement from "./PersonElement";

const PersonList = ({displayedPersons}) => {
    return(
        <div>
        {displayedPersons.map(person =>
          <PersonElement key={person.name} name={person.name} number={person.number}/>)}
      </div>
    )
}

export default PersonList
